import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './EventOrganization.css';

const EventOrganization = () => {
    const [organizedEvents, setOrganizedEvents] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchOrganizedEvents = async () => {
            try {
                const response = await fetch('http://localhost:8080/api/my_events/organization', {
                    headers: {
                        Authorization: `Bearer ${localStorage.getItem('token')}`, // Authorization header
                    },
                });

                if (!response.ok) {
                    throw new Error('Ошибка при загрузке организованных мероприятий');
                }

                const data = await response.json();
                if (Array.isArray(data)) {
                    setOrganizedEvents(
                        data.map((event) => ({
                            ...event,
                            eventTime: new Date(event.eventTime).toLocaleString('ru-RU', {
                                year: 'numeric',
                                month: 'long',
                                day: 'numeric',
                                hour: '2-digit',
                                minute: '2-digit',
                            }),
                        }))
                    );
                } else {
                    throw new Error('Некорректный формат данных с сервера');
                }
            } catch (error) {
                console.error('Ошибка загрузки мероприятий:', error.message);
                setError(error.message);
                setOrganizedEvents([]);
            } finally {
                setLoading(false);
            }
        };

        fetchOrganizedEvents();
    }, []);

    return (
        <div className="event-organization-page">
            <div className="header">
                <button onClick={() => navigate('/my_bookings')}>Я посещаю</button>
                <button onClick={() => navigate('/my_events')}>Я организую</button>
                <button onClick={() => navigate('/create_event')}>+Создать событие</button>
                <button onClick={() => navigate('/account')}>Акк</button>
            </div>
            <div className="main-content">
                <h1>Я организовываю</h1>
                {loading && <p className="loading-message">Загрузка мероприятий...</p>}
                {error && <p className="error-message">Ошибка: {error}</p>}
                {!loading && !error && organizedEvents.length > 0 ? (
                    <table className="events-table">
                        <thead>
                            <tr>
                                <th>Название</th>
                                <th>Дата и время</th>
                                <th>Количество билетов</th>
                                <th>Ссылка на событие</th>
                            </tr>
                        </thead>
                        <tbody>
                            {organizedEvents.map((event) => (
                                <tr key={event.id}>
                                    <td>{event.title}</td>
                                    <td>{event.eventTime}</td>
                                    <td>{event.ticketsAvailable}</td>
                                    <td>
                                        <button
                                            className="link-button"
                                            onClick={() => navigate(`/event_card/${event.id}`)}
                                        >
                                            тык
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    !loading &&
                    !error && <p className="no-events">Вы ещё не организовывали событий.</p>
                )}
            </div>
        </div>
    );
};

export default EventOrganization;
